import React from 'react'

import {
    Row,
    Col,
} from 'react-bootstrap';


export default function WizardSteps() {

    return (
        <Row className="" style={{backgroundColor: 'red'}}> 
            
            <Col>
                <div className="wizard-step-circle d-flex">
                    <p className="m-auto">1</p>
                </div>
                <div>
                    <p>Page Selection</p>
                </div>
            </Col>

            

        </Row>
    )
}
